import "./WorkComponent.css";

function WorkComponent(props) {
  return (
    <div className="work-container">
      <div className="work-header">
        <h6 id="work-title">{props.title}</h6>
        <div id="sm-container">
          <h6 id="work-dates">{props.dates}</h6>
          <button id="open-button">{props.isOpen ? "+" : "-"}</button>
        </div>
      </div>
      {props.isOpen == "true" &&
        <div></div>
      }
    </div>
  );
}

export default WorkComponent;
